import React from "react";
import ItemDetail from "./ItemDetail";

const ItemDetailContainer = () => {
//detalle de mi prod
 
  const data = [
    { id:1, Nombre: "Suscripcion Premium", Precio: "U$D" + " " + 325, img:"https://i.ibb.co/b6fjcC5/PREMIUM.png"},
    { id:2, Nombre: "Suscripcion Platino", Precio: "U$D" + " " + 262, img:"https://i.ibb.co/frDf6s8/PLATA.png"},
    { id:3, Nombre: "Suscripcion Bronce", Precio: "U$D" + " " + 140, img:"https://i.ibb.co/qrn41dK/BRONZ.png"}
  ];
  

  return (
    <div>
 {data.map((item)=>(<ItemDetail key={item.id} id={item.id} />))}
    </div>
  );
};

export default ItemDetailContainer;
